import { Typography } from '@material-ui/core';
import 'bootstrap/dist/css/bootstrap.min.css';
import about from './img/about.jpg'
import {makeStyles} from "@material-ui/core/styles";


const useStyles = makeStyles((theme) => ({
    centerText : {
        position: 'absolute',
        top: '70%' ,
        left: '25%' ,
        fontSize : '30px',
        fontWeight : 'bold',
        transform: "translate('-50%' , -'50%' )" ,
        width: '30%',
        height: 'auto',
    },
    h:{
        marginTop : '20%',
        color: "green"
    },

}));

export default function About() {

    const myClass = useStyles();

    return(

        <div className="container">
            <div className="row">
                <div className="col-xs-12">
                    <img src={about} width = '100%' height = 'auto' />
                    <Typography className={myClass.centerText}>Inspired by Global Experiences, Fueled by Hard Work And Passion</Typography>
                </div>
            </div>
            <div className="row">
            <div className="col-xs-12">
                    <h3 className={myClass.h}>Who are we ?</h3>
                </div>
            </div>


        </div>
    )
}
